import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on Electronics category to navigate to a page with price filter
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for price filter to appear and take screenshot
    await page.waitForSelector('.price-filter', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_page.png'));

    // Fill price range inputs
    await page.fill('#minPrice', '50');
    await page.fill('#maxPrice', '200');

    // Click apply filter button
    await page.click('.apply-filter');

    // Wait for filter to be applied and take final screenshot
    await page.waitForTimeout(1000); // Brief pause for UI update
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_filter_applied.png'));

    // Extract product count after filtering
    const productCount = await page.$$eval('.product-card, .product-card-list', elements => elements.length);

    return {
      success: true,
      action: "Applied price range filter of $50-$200 to Electronics category",
      extractedData: {
        filteredProductsCount: productCount,
        minPrice: 50,
        maxPrice: 200
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
